<!DOCTYPE html>
<html lang='en'>
<head>
    <meta charset='UTF-8'>
    <meta name='viewport' content='width=device-width, initial-scale=1.0'>
    <title>Prediction Tool for 6-month JAKi Treatment Outcomes in RA Patients</title>
    <style>
        body { font-family: 'Times New Roman', serif; margin: 40px; background-color: #f7f7f7; color: #333333; font-size: 16px; }
        h1 { text-align: center; margin-bottom: 20px; font-size: 28px; }
        .container { max-width: 900px; margin: 0 auto; background-color: #fff; padding: 25px 35px; border-radius: 8px; box-shadow: 0 2px 5px rgba(0,0,0,0.1); }
        .form-row { display: flex; flex-wrap: wrap; gap: 20px; }
        .form-group { flex: 1 1 calc(50% - 20px); display: flex; flex-direction: column; margin-bottom: 10px; }
        .form-group label { font-size: 16px; margin-bottom: 5px; }
        .form-group input, .form-group select { padding: 7px; font-size: 16px; border: 1px solid #ccc; border-radius: 4px; }
        #predictBtn { display: block; margin: 30px auto 10px; padding: 12px 36px; font-size: 18px; background-color: #4a8fd7; color: #fff; border: none; border-radius: 4px; cursor: pointer; }
        #predictBtn:hover { background-color: #3e78ba; }
        #result { text-align: center; margin-top: 25px; font-size: 18px; font-weight: bold; }
    </style>
</head>
<body>
    <h1>Prediction Tool for 6-month JAKi Treatment Outcomes in RA Patients</h1>
    <div class='container'>
        <div class='form-group'>
            <label for='outcome'>Select Outcome Variable:</label>
            <select id='outcome' style='font-size:16px; padding:7px;'>
                <option value='6-month DSA28CRP remission(True=1,false=0)'>6-month DAS28CRP remission</option>

        </div>
        <div class='form-row'>
            <div class='form-group'>

                <input type='number' id='Age(years)' placeholder='Enter value' step='any'>
            </div>
            <div class='form-group'>
                <label for='Duration from diagnosis(months)'>Duration from diagnosis(months):</label>
                <input type='number' id='Duration from diagnosis(months)' placeholder='Enter value' step='any'>

                <label for='BMI'>BMI:</label>
                <input type='number' id='BMI' placeholder='Enter value' step='any'>
            </div>
            <div class='form-group'>
                <label for='MTX at baseline(True=1,false=0)'>MTX at baseline(True=1,false=0):</label>
                <select id='MTX at baseline(True=1,false=0)'>
                    <option value=''>Select</option>
                    <option value='0'>0</option>
                    <option value='1'>1</option>
                </select>
            </div>
            <div class='form-group'>
                <label for='Baseline TJC'>Baseline TJC:</label>
                <input type='number' id='Baseline TJC' placeholder='Enter value' step='any'>
            </div>
            <div class='form-group'>
                <label for='Baseline SJC'>Baseline SJC:</label>
                <input type='number' id='Baseline SJC' placeholder='Enter value' step='any'>

                <label for='Baseline EGA(0-100)'>Baseline EGA(0-100):</label>

            <div class='form-group'>
                <label for='Baseline CRP(mg/L)'>Baseline CRP(mg/L):</label>
                <input type='number' id='Baseline CRP(mg/L)' placeholder='Enter value' step='any'>
            </div>
            <div class='form-group'>
                <label for='Gender(Female=0,male=1)'>Gender(Female=0,male=1):</label>
                <select id='Gender(Female=0,male=1)'>
                    <option value=''>Select</option>
                    <option value='0'>0</option>
                    <option value='1'>1</option>
                </select>
            </div>
            <div class='form-group'>

                    <option value='0'>0</option>
                    <option value='1'>1</option>
                </select>
            </div>
            <div class='form-group'>

                    <option value=''>Select</option>
                    <option value='0'>0</option>
                    <option value='1'>1</option>
                </select>
            </div>
            <div class='form-group'>
                <label for='Tofa at Baseline(True=1,false=0)'>Tofa at Baseline(True=1,false=0):</label>

                    <option value=''>Select</option>
                    <option value='0'>0</option>
                    <option value='1'>1</option>
                </select>
            </div>
            <div class='form-group'>
                <label for='Bari at Baseline(True=1,false=0)'>Bari at Baseline(True=1,false=0):</label>

                    <option value=''>Select</option>
                    <option value='0'>0</option>
                    <option value='1'>1</option>
                </select>
            </div>
            <div class='form-group'>

                    <option value=''>Select</option>
                    <option value='0'>0</option>
                    <option value='1'>1</option>
                </select>
            </div>
            <div class='form-group'>
                <label for='Other csDMARD at baseline(True=1,false=0)'>Other csDMARD at baseline(True=1,false=0):</label>
                <select id='Other csDMARD at baseline(True=1,false=0)'>
                    <option value=''>Select</option>
                    <option value='0'>0</option>
                    <option value='1'>1</option>
                </select>
            </div>
            <div class='form-group'>

                    <option value=''>Select</option>
                    <option value='0'>0</option>
                    <option value='1'>1</option>

                    <option value=''>Select</option>
                    <option value='0'>0</option>
                    <option value='1'>1</option>

                    <option value=''>Select</option>
                    <option value='0'>0</option>
                    <option value='1'>1</option>
                </select>

        </div>
        <button id='predictBtn'>Predict</button>
        <div id='result'></div>

        function scaleFeatures(input) {
            const features = [];
            const contCols = modelData.continuous_cols;
            const binCols = modelData.binary_cols;
            for (let i = 0; i < contCols.length; i++) {
                const col = contCols[i];
                const value = parseFloat(input[col]);
                const mean = modelData.means[col];
                const scale = modelData.scales[col];
                const scaled = (value - mean) / scale;
                features.push(scaled);
            }
            for (let i = 0; i < binCols.length; i++) {
                const col = binCols[i];
                const value = parseFloat(input[col]);
                features.push(value);
            }
            return features;
        }
        function predictLogistic(model, features) {
            let logit = model.intercept;
            for (let i = 0; i < model.coef.length; i++) {
                logit += model.coef[i] * features[i];
            }
            const prob = 1 / (1 + Math.exp(-logit));
            return prob;
        }
        function predictTree(tree, features) {
            let node = 0;
            while (tree.children_left[node] !== -1) {
                const featureIndex = tree.feature[node];
                const threshold = tree.threshold[node];
                if (features[featureIndex] <= threshold) {
                    node = tree.children_left[node];
                } else {
                    node = tree.children_right[node];
                }
            }
            const val = tree.value[node];
            const sum = val[0] + val[1];
            return val[1] / sum;
        }
        function predictRandomForest(model, features) {
            const trees = model.trees;
            let probSum = 0;
            for (let i = 0; i < trees.length; i++) {
                probSum += predictTree(trees[i], features);
            }
            return probSum / trees.length;
        }
        function predict() {
            const outcome = document.getElementById('outcome').value;
            const input = {}; 
            for (const col of modelData.feature_order) {
                const elem = document.getElementById(col);
                const val = elem.value;
                if (val === '') {
                    alert('Please fill/select value for ' + col);
                    return;
                }
                input[col] = val;
            }
            const features = scaleFeatures(input);
            const model = modelData.models[outcome];
            let prob = 0;
            if (model.type === 'logistic') {
                prob = predictLogistic(model, features);
            } else {
                prob = predictRandomForest(model, features);
            }
            const pred = prob >= 0.5 ? 1 : 0;
            document.getElementById('result').textContent = 'Predicted Outcome: ' + pred + ' (Probability: ' + (prob * 100).toFixed(2) + '%)';
        }
        document.getElementById('predictBtn').addEventListener('click', predict);
